import React, { useEffect, useState } from "react";
import axios from "axios";
import "./payment.css";

export default function Payments() {
  const [orders, setOrders] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:7000/admin/orders")
      .then(res => setOrders(res.data))
      .catch(err => console.log(err));
  }, []);

  const totalRevenue = orders
    .filter(o => o.status === "succeeded")
    .reduce((sum, o) => sum + o.totalAmount, 0);

  const updateStatus = (id, status) => {
    axios
      .put(`http://localhost:7000/admin/order-status/${id}`, { status })
      .then(() => {
        setOrders(
          orders.map(o =>
            o._id === id ? { ...o, status } : o
          )
        );
      });
  };

  return (
    <div className="pay-page">
      <h2 className="pay-title">Admin Dashboard</h2>

      <div className="pay-stats">
        <div className="stat-card">
          <span>Total Orders</span>
          <b>{orders.length}</b>
        </div>
        <div className="stat-card">
          <span>Paid Revenue</span>
          <b>₹{totalRevenue}</b>
        </div>
      </div>

      <div className="pay-table-container">
        <table className="pay-table">
          <thead>
            <tr>
              <th>User</th>
              <th>Products</th>
              <th>Amount</th>
              <th>Payment ID</th>
              <th>Status</th>
              <th>Update</th>
            </tr>
          </thead>
          <tbody>
            {orders.map(o => (
              <tr key={o._id}>
                <td>{o.userId || "Guest"}</td>
                <td>
                  {o.cartItems && o.cartItems.length ? (
                    o.cartItems.map(item => (
                      <div key={item.id} className="order-item">
                        <img src={item.image} alt={item.name} className="order-img"/>
                        <div>{item.name} x {item.quantity}</div>
                      </div>
                    ))
                  ) : (
                    "No items"
                  )}
                </td>
                <td>₹{o.totalAmount}</td>
                <td>{o.paymentId}</td>
                <td>
                  <span className={`status ${o.status}`}>{o.status}</span>
                </td>
                <td>
                  <select
                    className="status-select"
                    value={o.status}
                    onChange={e => updateStatus(o._id, e.target.value)}
                  >
                    <option value="pending">Pending</option>
                    <option value="succeeded">Paid</option>
                    <option value="cod">COD</option>
                  </select>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}
